// src/pages/LoginPage.js
import React from 'react';
import LoginForm from '../components/LoginForm';
import GoogleLoginButton from '../components/GoogleLoginButton';

const LoginPage = () => {
  return (
    <div>
      <h2>Login</h2>
      <LoginForm />

      <hr />
      <h3>Or Login with Google</h3>
      <GoogleLoginButton />
    </div>
  );
};

export default LoginPage;
